<span class="line"><span style="color: #ABB2BF">yarn </span><span style="color: #98C379">add</span><span style="color: #ABB2BF"> </span><span style="color: #D19A66">--dev</span><span style="color: #ABB2BF"> </span><span style="color: #98C379">react-native-typescript-transformer</span></span>
